import Contact from "./Contact";

const App = () => {
  const contacts = [
    {
      name: "rajan",
      num: "985",
      location: "Nepal",
    },
    {
      name: "mahesh",
      num: "982567",
      location: "Japan",
    },
    {
      name: "aaku",
      num: "98256788",
      location: "Nepal",
    }
  ];
  return (
    <>
      <div className=".container">
        <h3>Contact List:</h3>
      </div>
      <div className="contact">
        <Contact name={contacts[0]['name']} num="9825674877" addr="Nepal" />
        <Contact name="Mahesh" num="987235663" addr="Japan" />
        <Contact name="Aaku" num="9706728080" addr="Nepal" />
      </div>
    </>
  );
};

export default App;
